import React from 'react';
import { Route, Switch } from 'react-router-dom';
import { ReactRouterExample, AboutMe, Resume } from './pages'

function App() {
  return (
    <div>
      <ReactRouterExample>
        <Switch>
          <Route path="/AboutMe" component={AboutMe} />
          <Route path="/Resume" component={Resume} />
        </Switch>
      </ReactRouterExample>
    </div>
  );
}

export default App;
